description:
The goal of this project is to support long-term and large-scale restoration of selected government, community, and private forests in the Budongo-Bugoma Corridor in western Uganda through a public-private partnership for forest restoration and management. JGI proposes rehabilitation of the land by the planting of mixed local native tree species to create conservation forests. The restored community forests will be buffered by a combination of community and private agroforestry woodlots, and plantation of selected fast-growing timber/fuelwood and fruit species to ensure sustainability, provide alternatives to fuelwood needs, and ultimately provide significant ecological and socio-economic cultural benefits. 

JGI recently facilitated the formation of Private Forest Owners� Associations (PFOAs); supported forest owners in surveying and registering their land; facilitated the assignment of forest management rights; trained and equipped the forest owners in sustainable forest management practices; as well as trained and equipped forest owners with the tools and skills to monitor forests using mobile technologies and near-real-time forest loss alerts derived from satellite imagery. The proposed project will expand this existing capacity to advance forest restoration and livelihood-related strategies. 

The project proposes the implementation of the following six strategies:

1.Restore degraded areas managed by communities in the forest corridor;
2.Restore degraded areas in Central Forest Reserves;
3.Promote agroforestry practices on community and private land;
4.Promote livelihood activities that holistically foster ecosystem health and socio-economic wellbeing; 
5.Strengthen forest monitoring and law enforcement; and
6.Creating a multi-stakeholder forum for planning and implementing landscape-scale activities promoting forest ecosystem conservation and restoration.

These project strategies will address the threats that contribute to forest degradation and will focus on forest clearing for agriculture and unsustainable harvesting. In dealing with these threats, the project will also address underlying problems such as increased demand for forest products (i.e., poles, timber, for construction, charcoal production; firewood for domestic use) through establishing alternatives and incentives as safety nets for the demand of forest products.

The Mount Bamboutos Initiative (MBI) is a joint initiative developed by ERuDeF and ITF in partnership with the government of Cameroon that aims to restore the biodiversity and ecosystem functions of the degraded Mount Bamboutos landscape while securing the livelihoods of local and indigenous population. Specifically, the project aims to restore 35,000 hectares of the degraded landscape through the planting of 15 million agroforestry and indigenous tree species to secure the livelihoods of over 30,000 people. Due to anthropogenic activities such as poaching, deforestation, bush fires, poor farming practices and urbanization, the Mount Bamboutos landscape has been severely degraded. Therefore ERuDeF has taken various steps to salvage the landscape with objectives in relation to governance, livelihoods development, biodiversity, forest landscape restoration, women and gender, research and development and sustainable finance. 
The objectives are as follows:
1. Plant 15 million trees for restoring over 35,000 ha of the degraded landscape;
2. Build the capacity of over 30,000 people on mountain ecosystem restoration, participatory land use planning and zoning and establishing effective forest governance systems and structures;
3. Ensure food security and economic resilience for over 30,000 households;
4. Restore and secure key biodiversity areas through the the update of Mt Bamboutos ecological reserve into Mt Bamboutos Plantlife Sanctuary, the creation of community forests and protection of riparian and sacred forests;
5. Promote and integrate women and gender initiatives in ecosystem restoration and livelihood diversification; 
6. Mainstream applied research for development to support long term ecosystem restoration success and sustainable development;
7. Establish long-term sustainable financing mechanisms to ensure sustainability in ecosystem restoration and local economic development.

The project was launched in August 2018 with the support from the Darwin Initiative, TreeSisters, FFEM (French Global Fund for Environment small grants programme) and, ERuDeF in collaboration with ITF.
